import axios from 'axios';

const replicateFromSQL = async (db, replicationUrl, time = 10000) => {
    setInterval(async () => {
        let { data } = await axios.get(replicationUrl);
        await db.bulkDocs({ docs: data });
    }, time)
};

export default replicateFromSQL;
